import React from 'react'
import { Bar } from 'react-chartjs-2'
import {Chart as ChartJS} from 'chart.js/auto'


const BarChart = () => {
    return (
        <div>
            <Bar
                data={{
                    labels: ['Actual Velocity', 'Expected Velocity'],
                    datasets:[{
                        label: '# of votes',
                        data: [12, 19, 3, 5, 2, 3],
                        backgroundColor: [
                            'rgba(255, 99, 132, 0.2)',
                            'rgba(54, 162, 235, 0.2)',
                        ],
                        borderColor: [
                            'rgba(255, 99, 132, 1)',
                            'rgba(54, 162, 235, 1)',
                        ],
                        borderWidth: 1
                    }]
                }}
                height={200}
                width={100}
                options={{maintainAspectRatio: true,}}
            />
        </div>
    )
}

export default BarChart;
